import React from 'react'

  export default function ContentHome() {
    return (
        <div className="content-wrapper" >
            <b><p>Hello, </p></b>
            <b><p>This is content for home page and it suppose to have Cesium</p></b>
            <b><p>If you get directed here, it could mean:</p></b>
            <b><p>1. That link you clicked suppose to bring you home</p></b>
            <b><p>2. That page havent been created yet (or called to used) For example: all "expand" and "table" pages are yet to be created (because i dont know how to make it different from the table we already have when we view "graph")</p></b>
                
        </div>
        
        
    )
}
